import React from 'react';
import {Link} from 'react-router-dom';

import {Box, ListItemIcon, ListItemButton, Grid} from '@mui/material';

const NavItem = (tag) => {
    return (
        <Grid item key={tag.id}>
            <Link to='#' color={tag.color}>
                {tag.title}qwe
            </Link>
        </Grid>
    );
}

export default NavItem;
